// Navbar.js
import React, { Component } from 'react';

export class Navbar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      query: ''
    };
  }

  handleInputChange = (e) => {
    this.setState({ query: e.target.value });
  };

  handleSearchSubmit = (e) => {
    e.preventDefault();
    this.props.onSearch(this.state.query);
  };

  render() {
    return (
      <div>
        <nav className="navbar navbar-expand-lg bg-body-tertiary">
          <div className="container-fluid">
            <a className="navbar-brand" href="#"><h1>React News Portal</h1></a>
            <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarSupportedContent">
              <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                <li className="nav-item">
                  <a className="nav-link active" aria-current="page" href="#"><h3>Home</h3></a>
                </li>
                <li className="nav-item dropdown">
                  <a className="nav-link dropdown-toggle" href="/" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                  <h3>
                    Categories</h3>
                  </a>
                  <ul className="dropdown-menu">
                    <li><a className="dropdown-item" href="#" onClick={() => this.props.onCategoryChange('business')}>Business</a></li>
                    <li><a className="dropdown-item" href="#" onClick={() => this.props.onCategoryChange('entertainment')}>Entertainment</a></li>
                    <li><a className="dropdown-item" href="#" onClick={() => this.props.onCategoryChange('technology')}>Technology</a></li>
                    <li><a className="dropdown-item" href="#" onClick={() => this.props.onCategoryChange('education')}>Education</a></li>
                    <li><hr className="dropdown-divider" /></li>
                    <li><a className="dropdown-item" href="#" onClick={() => this.props.onCategoryChange('general')}>General</a></li>
                  </ul>
                </li>
              </ul>
              <form className="d-flex" onSubmit={this.handleSearchSubmit}>
                <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" value={this.state.query} onChange={this.handleInputChange} />
                <button className="btn btn-outline-success" type="submit">Search</button>
              </form>
            </div>
          </div>
        </nav>
      </div>
    );
  }
}

export default Navbar;
